import React from "react";

const ContentApiDetails = ({ covidDetails }) => {
  const { TotalPositive, TotalDeath, TotalRecovered } = covidDetails;
  console.log(TotalPositive);
  return (
    <div>
      <ul>
        <li>{TotalPositive}</li>
        <li>{TotalDeath}</li>
        <li>{TotalRecovered}</li>
      </ul>
    </div>
  );
};

export default ContentApiDetails;
